import React from 'react';
import { Card } from 'antd';
import { ItemPanel, Item } from 'gg-editor';
import { useSelector } from 'react-redux';

import { isDirNode } from '../../../../common/utils';

const FlowItemPanel = () => {
  const currentCheckedTreeNode = useSelector(
    state => state.grapheditor.currentCheckedTreeNode
  );
  const processTree = useSelector(state => state.grapheditor.processTree);
  const isProcessNode =
    currentCheckedTreeNode && !!!isDirNode(processTree, currentCheckedTreeNode);

  if (!isProcessNode) return null;
  return (
    <ItemPanel className="designergraph-container-itemPanel">
      {/* <Card bordered={false}> */}
      <Item
        type="node"
        size="40*40"
        //shape="flow-circle"
        shape="start-node"
        model={{
          color: '#FA8C16',
          label: '开始',
          style: {
            stroke: 'rgba(61, 109, 204, 1)',
            fill: '#ecf5f6',
          },
        }}
        // src="data:image/svg+xml;base64,"
      >
        <div className="item item__circle">开始</div>
      </Item>
      <Item
        type="node"
        size="184*56"
        shape="processblock"
        icon="http://bpic.588ku.com/element_origin_min_pic/00/92/88/9056f24073c4c87.jpg"
        model={{
          color: '#1890FF',
          label: '流程块',
          style: {
            stroke: 'rgba(61, 109, 204, 1)',
            fill: '#ecf5f6',
          },
        }}

        // src="data:image/svg+xml;base64,"
      >
        <div className="item item__rect">流程块</div>
      </Item>
      <Item
        type="node"
        size="104*104"
        shape="rhombus-node"
        model={{
          color: '#13C2C2',
          label: '判断',
          style: {
            stroke: 'rgba(61, 109, 204, 1)',
            fill: '#ecf5f6',
          },
        }}
        //src="data:image/svg+xml;base64,"
      >
        <div className="item item__diamond">判断</div>
      </Item>
      <Item
        type="node"
        size="70*48"
        shape="end-node"
        model={{
          color: '#722ED1',
          label: '结束',
          style: {
            stroke: 'rgba(61, 109, 204, 1)',
            fill: '#ecf5f6',
          },
        }}
        //src="data:image/svg+xml;base64,"
      >
        <div className="item item__ellipse">结束</div>
      </Item>
      <Item
        type="node"
        size="10*10"
        shape="group"
        model={{
          color: '#722ED1',
          label: '',
          style: {
            stroke: 'rgba(61, 109, 204, 1)',
            fill: '#ecf5f6',
          },
        }}
      >
        <div className="item item__ellipse">循环</div>
      </Item>
    </ItemPanel>
  );
};

export default FlowItemPanel;
